class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if set(s).issubset(set(t)):
            u = ''.join([i for i in t if i in s])
            index = 0
            i = 0
            while i < len(u) and index < len(s):
                if u[i] == s[index]:
                    index += 1
                i += 1
            return s in u or s == '' or index == len(s)
        else:
            return False


s = Solution()

print(s.isSubsequence("leeeeetcode",
                      ""))

